const Calendar = () => {
    return (
        <div>
            <p>Calendar</p>
                <Link to="/events" className='create-calendar-cta'>
            <div className='event-adding'>
                <p>Create +</p>
            </div>
                </Link>

        </div>
    )
}

export default Calendar;
